import React from 'react';
import TeamMember from './TeamMember';

function Team(){


    return(
        <div className='row'>
            <TeamMember name='Raghad'/>
            <TeamMember name='Ahmad'/>
            <TeamMember name='Yassin'/>
        </div>

    );
}

export default Team;
